import { createRouter, createWebHistory } from 'vue-router';
import HomePage from '../components/TelaInicial.vue';
import LoginPage from '../components/TelaLogin.vue';
import VisitantesPage from '../components/TelaVisitantes.vue';

const routes = [
  { path: '/', component: HomePage },
  { path: '/login', component: LoginPage },
  { path: '/visitantes', component: VisitantesPage },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
